export const CardChip = ({ size = 46 }) => {
  return (
    <svg
      fill="none"
      viewBox="0 0 46 42"
      xmlns="http://www.w3.org/2000/svg"
      style={{
        width: size,
        height: size * (42 / 46),
      }}
    >
      <rect width={46} height={42} fill="url(#a)" rx={5} />
      <defs>
        <pattern
          id="a"
          width={1}
          height={1}
          patternContentUnits="objectBoundingBox"
        >
          <use
            xlinkHref="#b"
            transform="matrix(.01087 0 0 .0119 -.152 -.071)"
          />
        </pattern>
        <image
          xlinkHref="data:image/png;base64,"
          id="b"
          width={118}
          height={98}
        />
      </defs>
    </svg>
  );
};

interface IssuersProps {
  size?: number;
  type: string;
}

const Issuers = ({ type, size }: IssuersProps) => {
  switch (type) {
    case "mastercard":
      return <MasterCard size={size} />;
    case "visa":
      return <Visa />;
    case "metamask":
      return <Metamask size={size} />;
    default:
      return <></>;
  }
};

export default Issuers;
